import React from 'react';
import JobCard from './JobCard';
import Pagination from '../common/Pagination';
import LoadingSpinner from '../common/LoadingSpinner';
import { Job } from '../../types/jobs';

interface JobListProps {
  jobs: Job[];
  loading: boolean;
  filters: any;
  onFiltersChange: (filters: any) => void;
  totalCount: number;
  onEditJob?: (job: Job) => void;
  onArchiveJob?: (job: Job) => void;
  onApplyJob?: (job: Job) => void;
}

const JobList: React.FC<JobListProps> = ({
  jobs,
  loading,
  filters,
  onFiltersChange,
  totalCount,
  onEditJob,
  onArchiveJob,
  onApplyJob
}) => {
  if (loading) {
    return (
      <div className="flex justify-center items-center py-12">
        <LoadingSpinner size="lg" />
      </div>
    );
  }

  if (jobs.length === 0) {
    return (
      <div className="text-center py-12">
        <div className="mx-auto w-24 h-24 bg-gradient-to-r from-gray-200 to-gray-300 rounded-full flex items-center justify-center mb-4">
          <svg className="w-10 h-10 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
          </svg>
        </div>
        <h3 className="text-lg font-medium text-gray-900 mb-2">No jobs found</h3>
        <p className="text-gray-500 max-w-sm mx-auto">
          {filters.search || filters.tags.length > 0 
            ? 'Try adjusting your search filters to find what you are looking for.'
            : 'There are currently no jobs matching your criteria.'
          }
        </p>
        {(filters.search || filters.tags.length > 0) && (
          <button
            onClick={() => onFiltersChange({
              search: '',
              status: '',
              tags: [],
              page: 1,
              pageSize: 12,
              sort: 'createdAt_desc'
            })}
            className="mt-4 inline-flex items-center px-4 py-2 text-sm font-medium text-blue-700 bg-blue-100 rounded-lg hover:bg-blue-200 transition-colors duration-150"
          >
            Clear all filters
          </button>
        )}
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Results Header */}
      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between gap-4">
        <div>
          <h2 className="text-lg font-semibold text-gray-900">
            {filters.search ? 'Search Results' : 'All Jobs'}
          </h2>
          <p className="text-sm text-gray-600">
            Showing <span className="font-semibold">{jobs.length}</span> of{' '}
            <span className="font-semibold">{totalCount}</span> jobs
          </p>
        </div>
        
        {/* Sort Options */}
        <div className="flex items-center space-x-2">
          <label htmlFor="sort" className="text-sm font-medium text-gray-700 whitespace-nowrap">
            Sort by:
          </label>
          <select
            id="sort"
            value={filters.sort}
            onChange={(e) => onFiltersChange({ ...filters, sort: e.target.value, page: 1 })}
            className="block w-full pl-3 pr-10 py-2 text-base border-gray-300 focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm rounded-lg bg-white/60 backdrop-blur-sm border border-gray-300/60"
          >
            <option value="createdAt_desc">Newest First</option>
            <option value="createdAt_asc">Oldest First</option>
            <option value="title_asc">Title A-Z</option>
            <option value="title_desc">Title Z-A</option>
            <option value="applicants_desc">Most Popular</option>
          </select>
        </div>
      </div>

      {/* Jobs Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 xl:grid-cols-3 gap-6">
        {jobs.map((job) => (
          <JobCard
            key={job.id}
            job={job}
            onEdit={onEditJob}
            onArchive={onArchiveJob}
            onApply={onApplyJob}
          />
        ))}
      </div>

      {/* Pagination */}
      {totalCount > filters.pageSize && (
        <div className="flex justify-center pt-8">
          <Pagination
            currentPage={filters.page}
            totalPages={Math.ceil(totalCount / filters.pageSize)}
            onPageChange={(page) => onFiltersChange({ ...filters, page })}
          />
        </div>
      )}
    </div>
  );
};

export default JobList;
